export const createTestNode = (id, data = {}, config = {}) => {
    return Object.assign(Object.assign({}, config), { id, data: Object.assign({ props: {}, custom: {}, hidden: false, isCanvas: false, nodes: [], linkedNodes: {} }, data), related: {}, events: Object.assign({ selected: false, dragged: false, hovered: false }, (config.events || {})), rules: Object.assign({ canMoveIn: () => true, canMoveOut: () => true, canDrag: () => true, canDrop: () => true }, (config.rules || {})) });
};
